You can call async Swift functions from Rust. The Swift function is declared with async in the extern "Swift" block, and swift-bridge generates the necessary callback-based FFI to bridge Swift's async/await to Rust's async/await. #[swift_bridge::bridge]
mod ffi { enum NetworkError { Timeout, NotFound, } extern "Swift" { async fn fetch_user_count() -> u32; async fn fetch_data(succeed: bool) -> Result<u32, NetworkError>; }
} async fn example() { // Call async Swift function that returns a value let count = ffi::fetch_user_count().await; // Call async Swift function that can throw (returns Result in Rust) match ffi::fetch_data(true).await { Ok(data) => println!("Got data: {}", data), Err(e) => println!("Error: {:?}", e), }
} // Swift // Shared enums need Error conformance to be thrown
extension NetworkError: Error {} func fetch_user_count() async -> UInt32 { // ... async work ... return 42
} // IMPORTANT: Use typed throws to specify the exact error type
func fetch_data(succeed: Bool) async throws(NetworkError) -> UInt32 { // ... async work that might fail ... if !succeed { throw NetworkError.Timeout } return 123
} When a Swift function returns Result<T, E> in the bridge definition: The Swift function must use typed throws: throws(E) (requires Swift 5.9+) Throwing an error in Swift maps to Err(E) in Rust A successful return maps to Ok(T) Shared enums used as error types need Error conformance: extension MyError: Error {} The typed throws requirement ensures compile-time verification that your Swift function only throws the expected error type, preventing runtime errors from type mismatches.

