The swift-bridge project provides direct support for expressing the Rust+Swift FFI boundary using one or more bridge modules such as: #[swift_bridge::bridge]
mod ffi { extern "Rust" { fn generate_random_number() -> u32; }
} fn generate_random_number() -> u32 { rand::random()
} swift-bridge's original maintainer wrote swift-bridge for use in a cross platform application where he preferred to keep his FFI code separate from his application code. He believed that this separation would reduce the likelihood of him biasing his core application's design towards types that were easier to bridge to Swift. While in the future swift-bridge may decide to directly support other approaches to defining FFI boundaries, at present only the bridge module approach is directly supported. Users with other needs can write wrappers around swift-bridge to expose alternative frontends. The examples/without-a-bridge-macro example demonstrates how to reuse swift-bridge's code generation facilities without using a bridge module.

